/* eslint-disable no-unused-vars */
import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';

export default function Main() {
  return (
    <div
      className="p-5 mb-4 bg-light rounded-3"
      style={{ position: 'relative', marginLeft: '10%', display: 'block' }}
    >
      <div className="container-fluid py-5">
        <h1 className="display-5 fw-bold">Hello, this is a sleeping app.</h1>
        <p className="col-md-8 fs-4">
          We are here to help mothers to sleep more. Is it possible? Yes, you
          just need to know to to organize sleep of your baby.
        </p>
        <p>
          <Button variant="primary">I want to sleep more!</Button>
        </p>
      </div>
    </div>
  );
}
